import React from 'react'
import "../Sidebar/Sidebar.css"
import sidemenu from "../../Data/ItemData"

function Sidebar() {
  return (
    <div>
        {
            sidemenu.map((item)=>{
                return(
                    <div key={item.id}>
                      <span></span>{item.name}</div>
                )
            })
        }
    </div>
  )
}

export default Sidebar
